import React from "react";
import { Switch, Route, BrowserRouter as Router } from "react-router-dom";

import {
  DefaultFashionista,
  MainFashionista,
} from "./pages/default_fashionista";
import {
  DefaultFashionseeker,
  MainFashionseeker,
} from "./pages/default-fashionseeker";
import StaRegister from "./pages/sta_register";
import "./assets/font/actadisplay/style.css";
import "./assets/font/sofiapro/style.css";

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/" component={DefaultFashionista} />
          <Route exact path="/defaultseeker" component={DefaultFashionseeker} />
          <Route exact path="/mainsta" component={MainFashionista} />
          <Route exact path="/mainseeker" component={MainFashionseeker} />
          <Route exact path="/staregister" component={StaRegister} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
